import { Outlet } from "react-router-dom";
import { Suspense } from "react";
import NavigationBar from "./Navbar";

function RootLayout() {
  return (
    <>
      <NavigationBar />
      <Suspense fallback={<h2>Loading...</h2>}>
        <Outlet />
      </Suspense>
    </>
  );
}

export default RootLayout;
